import React from 'react';

export default function StudentNotice() {
  return (
    <div style={{ marginLeft: '51px', marginRight: '256px', marginTop: '28px', marginBottom: '60px' }}>
      <p style={{ fontfamily: 'Roboto', fontStyle: 'normal', fontWeight: 'normal', fontSize: '18px', lineHeight: '21px', color: '#4D4D4D' }}>Home <b>> <u>Notice</u></b></p>
      <div style={{ marginTop: '62px', display: 'flex' }}>
        <div style={{ height: '758px', width: '649px', background: '#FFFFFF', border: '1px solid #E7E7E7', boxShadow: '0px 2px 7px rgba(52, 52, 52, 0.35)', borderRadius: '5px' }}>
          <div style={{ height: '64px', width: '100%', background: '#F9F9F9', borderRadius: '4px 4px 0px 0px' }}></div>
          <div style={{ overflowY: 'auto', paddingLeft: '28px', paddingTop: '46px', paddingRight: '43px', paddingBottom: '37px' }}></div>
        </div>
        <div style={{ height: '394px', width: '724px', background: '#FFFFFF', border: '1px solid #E7E7E7', boxShadow: '0px 2px 7px rgba(52, 52, 52, 0.35)', borderRadius: '5px', marginLeft: '78px' }}></div>
      </div>
    </div>
  );
}
